import React from "react";
import Base from "../core/Base";

const AdminDashBoard = () => {
  return (
    <Base title="welcome to admin area" description="manage all of ur products here">
      <h1>this is profile page</h1>
    </Base>
  );
};
export default AdminDashBoard;
